TestRedrawCurrent:
  title: Superbill
  pageNumber:
  init:
    - .TestRedrawCurrent.formData.folderList@: =.TestRedrawCurrent.apiRequest.codeList.resp.doc

  formData:
    displayFlag: "block"
    imageFlag: "inline-block"
    scrollHeight: "0.84729064"
    tempData: ""
    currentProcedureName: ""
    selectData: ""
    selectedList: []
    btnColor: "#c1c1c1"
    currentCode: ""

  apiRequest:
    # 获取所有的 folder
    codeFolder:
      resp: ""
      folderInfo:
        # 当前facility的id
        id: "XbPpxgAAAAAHOQJCrBIABQ=="
        xfname: "ovid"
        type: "320000"
        maxcount: 20
      docAPI:
        get:
          api: rd
          dataIn: apiRequest.codeFolder.folderInfo
          dataOut: testpage.apiRequest.codeFolder.resp
    codeList:
      resp:
        doc:
          - category: office
            hashCode: "t"
            secondList:
              - code: "1"
                description: "test"
                hashCode: "t1"
              - code: "2"
                description: "test"
                hashCode: "t2"
          - category: follow
            hashCode: "798"
            secondList: ..mockData

          
        
      folderInfo:
        # 当前facility的id
        id: "XbPpxgAAAAAHOQJCrBIABQ=="
        xfname: "ovid"
        sCondition: "type IN (309760,312320)"
        maxcount: 500
      docAPI:
        get:
          api: rd
          dataIn: apiRequest.codeList.folderInfo
          dataOut: testpage.apiRequest.codeList.resp
  components:
    - type: scrollView
      style:
        ..style.scrollBox:
        height: ..formData.scrollHeight
      children:
        - type: list
          viewTag: selectFacilityListTag
          contentType: listObject
          listObject: ..formData.folderList
          iteratorVar: itemObject
          style:
            ..style.firstList:
            # display: =..formDataTemp.tabTemp.0.block
          children:
            - type: listItem
              itemObject:
              style:
                ..style.firstListItem:
              children:
                - type: view
                  viewTag: selectDataTag
                  style:
                    ..style.selectBox:
                  onClick:
                    - ..event.selectClick
                  children:
                    - type: label
                      text: Select
                      dataKey: itemObject.category
                      style:
                        ..style.selectLabel:
                    - type: image
                      path:
                        emit:
                          dataKey:
                            var: itemObject
                          actions:
                            - if:
                                - =.builtIn.array.containingValue:
                                    dataIn:
                                      object: =..formData.selectedList
                                      key: hashCode
                                      value: $var.hashCode
                                - selectOnBlue.svg
                                - selectOffBlue.svg
                      style:
                        ..style.selectImg:

                - type: scrollView
                  style:
                    ..style.secondScrollView:
                    display: itemObject.displayStyle
                  children:
                    - type: list
                      viewTag: selectViewTag
                      contentType: listObject
                      listObject: itemObject.secondList
                      iteratorVar: itemObject
                      style:
                        ..style.secondList:
                      children:
                        - type: listItem
                          viewTag: itemViewTag
                          itemObject:
                          style:
                            ..style.secondListItem:
                          children:
                            - type: image
                              path:
                                emit:
                                  dataKey:
                                    var: itemObject
                                  actions:
                                    - if:
                                        - =.builtIn.array.containingValue:
                                            dataIn:
                                              object: =..formData.selectedList
                                              key: hashCode
                                              value: $var.hashCode
                                        - selectOnBlue.svg
                                        - selectOffBlue.svg
                              style:
                                ..style.checkBoxImg:
                              onClick:
                                - ..event.checkBoxClick
                            - type: label
                              dataKey: itemObject.description
                              style:
                                ..style.checkBoxValue:
  event:
    checkBoxClick:
      - emit:
          dataKey:
            var: itemObject
          actions:
            - if:
                - =.builtIn.array.containingValue:
                    dataIn:
                      object: =..formData.selectedList
                      key: hashCode
                      value: $var.hashCode
                - =.builtIn.array.removeObjectByValue:
                    dataIn:
                      object: =..formData.selectedList
                      values: hashCode
                      value: $var.hashCode
                - =.builtIn.array.push:
                    dataIn:
                      messages: =..formData.selectedList
                      newMessage: $var
      - actionType: evalObject
        object:
          - if:
              - =.builtIn.array.judgeListLength:
                  dataIn:
                    array: =..formData.selectedList
                    len: 0
              - ..formData.btnColor@: "#c1c1c1"
              - ..formData.btnColor@: "#2988e6"
      # - actionType: builtIn
      #   funcName: redraw
      #   viewTag: selectViewTag
      - actionType: builtIn
        funcName: redrawCurrent
        viewTag: itemViewTag
      # - actionType: builtIn
      #   funcName: redraw
      #   viewTag: selectDataTag
      # - actionType: builtIn
      #   funcName: redraw
      #   viewTag: btnTag
  style:
    checkBoxValue:
      marginLeft: "0.032"
      display: "inline-block"
      width: "0.8106666"
      height: "auto"
      wordBreak: break-word
      fontSize: .Nfont.h14
      verticalAlign: top
    scrollBox:
      width: "1"
      # height: "0.84729064"
      boxSizing: "border-box"
      overflow: "scroll"
